    let nextCustomMidiNote = 50; // High Tom (GM Drum Map)から開始

    function adjustColor(hex, percent) {
        var f = parseInt(hex.slice(1), 16),
            t = percent < 0 ? 0 : 255,
            p = percent < 0 ? percent * -1 : percent,
            R = f >> 16,
            G = (f >> 8) & 0x00FF,
            B = (f & 0x0000FF);
        return "#" + (
            0x1000000 +
            (Math.round((t - R) * p) + R) * 0x10000 +
            (Math.round((t - G) * p) + G) * 0x100 +
            (Math.round((t - B) * p) + B)
        ).toString(16).slice(1);
    }

    const createGrid = () => {
        console.log('createGridが呼び出されました。現在のpatternの状態:', JSON.stringify(pattern));
        gridContainer.innerHTML = '';

        const stepWidth = 28;
        const stepGap = 4;
        const instrumentControlsWidth = 100;

        let gridColumnsDefinition = `minmax(${instrumentControlsWidth}px, auto)`;
        let calculatedGridWidth = instrumentControlsWidth;

        for (let i = 0; i < numSteps; i++) {
            gridColumnsDefinition += ` ${stepWidth}px`;
            calculatedGridWidth += stepWidth;
            if ((i + 1) % 4 === 0 && (i + 1) < numSteps) {
                gridColumnsDefinition += ` 15px`;
                calculatedGridWidth += 15;
            }
            if (i < numSteps - 1) {
                calculatedGridWidth += stepGap;
            }
        }

        calculatedGridWidth += 15 * 2;
        calculatedGridWidth += 5;

        gridContainer.style.gridTemplateColumns = gridColumnsDefinition;
        gridContainer.style.gridTemplateRows = `repeat(${instruments.length}, auto)`;
        gridContainer.style.width = `${calculatedGridWidth}px`;

        document.documentElement.style.setProperty('--grid-calculated-width', `${calculatedGridWidth}px`);

        instruments.forEach((instrument, instIndex) => {
            const gridRowIndex = instruments.length - instIndex;

            const instrumentControlsContainer = document.createElement('div');
            instrumentControlsContainer.classList.add('instrument-controls');
            instrumentControlsContainer.style.gridRow = gridRowIndex;
            instrumentControlsContainer.style.setProperty('--grid-row', gridRowIndex);
            instrumentControlsContainer.style.gridColumn = 1;

            const label = document.createElement('div');
            label.classList.add('instrument-label');
            label.textContent = instrument.name;
            label.style.backgroundColor = instrument.color;
            instrumentControlsContainer.appendChild(label);

            label.style.cursor = 'pointer';
            label.title = 'クリックして音源をアップロード';

            label.addEventListener('click', () => {
                const fileInput = document.createElement('input');
                fileInput.type = 'file';
                fileInput.accept = 'audio/*';
                fileInput.style.display = 'none';
                document.body.appendChild(fileInput);

                fileInput.addEventListener('change', async (event) => {
                    const file = event.target.files[0];
                    if (file) {
                        const reader = new FileReader();
                        reader.onload = async (e) => {
                            try {
                                const audioBuffer = await decodeBase64Audio(e.target.result);
                                instruments[instIndex].audioBuffer = audioBuffer;
                                instruments[instIndex].sampleName = file.name;
                                instruments[instIndex].isCustomSample = true;
                                instruments[instIndex].customSampleBase64 = e.target.result;

                                console.log(`Instrument ${instrument.name} loaded custom sample: ${file.name}`);
                            } catch (error) {
                                console.error('Error loading custom audio file:', error);
                                alert('選択されたオーディオファイルを読み込めませんでした。');
                            }
                        };
                        reader.readAsDataURL(file);
                    }
                    document.body.removeChild(fileInput);
                });

                fileInput.click();
            });


            const volumeControlWrapper = document.createElement('div');
            volumeControlWrapper.classList.add('volume-control-wrapper');

            const volumeSlider = document.createElement('input');
            volumeSlider.type = 'range';
            volumeSlider.min = '0';
            volumeSlider.max = '100';
            volumeSlider.step = '1';
            volumeSlider.value = Math.round(instrument.volume * 100);
            volumeSlider.dataset.instIndex = instIndex;
            volumeSlider.classList.add('volume-knob');

            volumeSlider.addEventListener('input', (event) => {
                const newVolumePercent = parseInt(event.target.value);
                const newVolume = newVolumePercent / 100;
                instruments[instIndex].volume = newVolume;
            });

            volumeControlWrapper.appendChild(volumeSlider);
            instrumentControlsContainer.appendChild(volumeControlWrapper);

            gridContainer.appendChild(instrumentControlsContainer);

            if (!pattern[instIndex]) {
                pattern[instIndex] = Array(numSteps).fill(false);
            }
            console.log(`楽器 ${instrument.name} (インデックス: ${instIndex}) のパターン状態:`, JSON.stringify(pattern[instIndex]));

            const inactiveStepColor = '#ecf0f1';
            const defaultBorderColor = adjustColor(instrument.color, -0.2);
            const activeBorderColor = '#FFFFFF';
            const activeBorderWidth = '2px';
            const defaultBorderWidth = '1px';

            for (let i = 0; i < numSteps; i++) {
                const step = document.createElement('div');
                step.classList.add('step');
                step.dataset.instIndex = instIndex;
                step.dataset.stepIndex = i;
                step.addEventListener('click', toggleStep);

                step.style.gridRow = gridRowIndex;

                let gridColumnStart = i + 2;
                gridColumnStart += Math.floor(i / 4);

                step.style.gridColumn = gridColumnStart;

                gridContainer.appendChild(step);

                step.dataset.activeColor = instrument.color;
                step.dataset.inactiveColor = inactiveStepColor;
                step.dataset.defaultBorder = `${defaultBorderWidth} solid ${defaultBorderColor}`;
                step.dataset.activeBorder = `${activeBorderWidth} solid ${activeBorderColor}`;

                if (pattern[instIndex] && pattern[instIndex][i]) {
                    step.classList.add('active');
                    step.style.backgroundColor = step.dataset.activeColor;
                    step.style.border = step.dataset.activeBorder;
                } else {
                    step.classList.remove('active');
                    step.style.backgroundColor = step.dataset.inactiveColor;
                    step.style.border = step.dataset.defaultBorder;
                }
                console.log(`  ステップ ${i} の状態: pattern[${instIndex}][${i}] = ${pattern[instIndex] && pattern[instIndex][i]} (設定されたクラス: ${step.classList.contains('active') ? 'active' : 'なし'})`);
            }
        });
        if (!isPlaying) {
            resetPlayBar();
        }
        updateAddTrackButtonState();
    };

    const toggleStep = (event) => {
        const step = event.target;
        const instIndex = parseInt(step.dataset.instIndex);
        const stepIndex = parseInt(step.dataset.stepIndex);

        if (!pattern[instIndex]) return;

        pattern[instIndex][stepIndex] = !pattern[instIndex][stepIndex];
        console.log(`ステップ ${instIndex}-${stepIndex} をトグル。新しい状態: ${pattern[instIndex][stepIndex]}`);

        if (pattern[instIndex][stepIndex]) {
            step.classList.add('active');
            step.style.backgroundColor = step.dataset.activeColor;
            step.style.border = step.dataset.activeBorder;
        } else {
            step.classList.remove('active');
            step.style.backgroundColor = step.dataset.inactiveColor;
            step.style.border = step.dataset.defaultBorder;
        }
    };

    const clearAllSteps = () => {
        console.log('Clear All Steps (only steps) initiated.');
        if (!pattern || pattern.length === 0) {
            console.log('No patterns to clear.');
            return;
        }

        pattern.forEach((instrumentPattern, instIndex) => {
            pattern[instIndex] = Array(numSteps).fill(false);
            console.log(`Pattern for instrument ${instIndex} reset.`);

            const steps = gridContainer.querySelectorAll(`.step[data-inst-index="${instIndex}"]`);

            steps.forEach(stepElement => {
                stepElement.classList.remove('active');
                stepElement.style.backgroundColor = stepElement.dataset.inactiveColor;
                stepElement.style.border = stepElement.dataset.defaultBorder;
            });
        });
        console.log('All steps cleared visually and in data model.');
    };

    const deleteAllTracks = () => {
        console.log('Delete All Tracks initiated.');
        if (confirm('全てのトラックとパターンを削除してもよろしいですか？この操作は元に戻せません。')) {
            if (isPlaying) {
                stopPlayback();
            }

            instruments = [];
            pattern = [];

            initializeDefaultTracks();
            nextCustomMidiNote = 50;

            console.log('All tracks and patterns deleted. Initializing default tracks.');

            currentPatternName = '';
            savePresetNameInput.value = ''; // プリセット名入力欄をクリア
            currentGenreName = '';
            genreNameInput.value = '';
            updateScreenshotPatternNameDisplay();
            resetPlayBar();
        } else {
            console.log('Track deletion cancelled.');
        }
    };

    const takeScreenshot = async () => {
        if (h1Title) h1Title.style.display = 'none';
        if (topControlsRow) topControlsRow.style.display = 'none';
        if (bottomControlsRow) bottomControlsRow.style.display = 'none';

        const tempCaptureContainer = document.createElement('div');
        tempCaptureContainer.style.background = '#FFFFFF';
        tempCaptureContainer.style.padding = '20px';
        tempCaptureContainer.style.borderRadius = '8px';
        tempCaptureContainer.style.boxShadow = '0 4px 8px rgba(0, 0, 0, 0.1)';
        tempCaptureContainer.style.position = 'absolute';
        tempCaptureContainer.style.left = '-9999px';
        tempCaptureContainer.style.top = '-9999px';
        tempCaptureContainer.style.display = 'flex';
        tempCaptureContainer.style.flexDirection = 'column';
        tempCaptureContainer.style.alignItems = 'flex-start';

        const clonedScreenshotPatternNameDisplay = screenshotPatternNameDisplay.cloneNode(true);
        clonedScreenshotPatternNameDisplay.style.width = '100%';
        clonedScreenshotPatternNameDisplay.style.marginTop = '0';
        clonedScreenshotPatternNameDisplay.style.marginBottom = '15px';
        clonedScreenshotPatternNameDisplay.style.color = '#333';
        clonedScreenshotPatternNameDisplay.style.textAlign = 'left';
        clonedScreenshotPatternNameDisplay.style.fontSize = '1.4em';
        clonedScreenshotPatternNameDisplay.style.fontWeight = 'bold';

        tempCaptureContainer.appendChild(clonedScreenshotPatternNameDisplay);

        const clonedGrid = gridContainer.cloneNode(true);
        tempCaptureContainer.appendChild(clonedGrid);

        const computedGridContainerStyle = getComputedStyle(gridContainer);
        clonedGrid.style.cssText = computedGridContainerStyle.cssText;
        clonedGrid.style.width = computedGridContainerStyle.width;
        clonedGrid.style.marginTop = '0';
        clonedGrid.style.backgroundColor = '#f0f0f0';
        clonedGrid.style.boxSizing = computedGridContainerStyle.boxSizing;

        Array.from(clonedGrid.children).forEach(clonedElement => {
            let originalElement;
            if (clonedElement.classList.contains('instrument-controls')) {
                const originalLabel = Array.from(gridContainer.querySelectorAll('.instrument-label'))
                                         .find(el => el.textContent === clonedElement.querySelector('.instrument-label')?.textContent);
                if (originalLabel) {
                    originalElement = originalLabel.closest('.instrument-controls');
                }
            } else if (clonedElement.classList.contains('step')) {
                originalElement = gridContainer.querySelector(`.step[data-inst-index="${clonedElement.dataset.instIndex}"][data-step-index="${clonedElement.dataset.stepIndex}"]`);
            }

            if (originalElement) {
                const computedOriginalStyle = getComputedStyle(originalElement);
                clonedElement.style.cssText = computedOriginalStyle.cssText;

                clonedElement.style.gridRow = computedOriginalStyle.gridRow;
                clonedElement.style.gridColumn = computedOriginalStyle.gridColumn;

                if (clonedElement.classList.contains('instrument-controls')) {
                    const clonedLabel = clonedElement.querySelector('.instrument-label');
                    const originalLabel = originalElement.querySelector('.instrument-label');
                    if (clonedLabel && originalLabel) {
                        clonedLabel.style.cssText = getComputedStyle(originalLabel).cssText;
                        clonedLabel.style.backgroundColor = originalLabel.style.backgroundColor;
                        clonedLabel.style.cursor = originalLabel.style.cursor;
                        clonedLabel.title = originalLabel.title;
                        clonedLabel.style.color = '#FFFFFF';
                    }
                    const clonedVolumeControlWrapper = clonedElement.querySelector('.volume-control-wrapper');
                    const originalVolumeControlWrapper = originalElement.querySelector('.volume-control-wrapper');
                    if (clonedVolumeControlWrapper && originalVolumeControlWrapper) {
                        clonedVolumeControlWrapper.style.cssText = getComputedStyle(originalVolumeControlWrapper).cssText;
                        const clonedKnob = clonedVolumeControlWrapper.querySelector('.volume-knob');
                        const originalKnob = originalVolumeControlWrapper.querySelector('.volume-knob');
                        if (clonedKnob && originalKnob) {
                            clonedKnob.style.cssText = getComputedStyle(originalKnob).cssText;
                            clonedKnob.value = originalKnob.value;
                        }
                    }
                }

                if (clonedElement.classList.contains('step')) {
                    if (originalElement.classList.contains('active')) {
                        clonedElement.classList.add('active');
                        clonedElement.style.backgroundColor = originalElement.dataset.activeColor;
                        clonedElement.style.border = originalElement.dataset.activeBorder;
                    } else {
                        clonedElement.classList.remove('active');
                        clonedElement.style.backgroundColor = originalElement.dataset.inactiveColor;
                        clonedElement.style.border = originalElement.dataset.defaultBorder;
                    }

                    if (originalElement.classList.contains('current-step')) {
                        clonedElement.classList.add('current-step');
                    } else {
                        clonedElement.classList.remove('current-step');
                    }
                }
            }
        });

        const gridActualWidth = gridContainer.offsetWidth;
        tempCaptureContainer.style.width = `${gridActualWidth + 40}px`;

        document.body.appendChild(tempCaptureContainer);

        try {
            const canvas = await html2canvas(tempCaptureContainer, {
                backgroundColor: '#FFFFFF',
            });

            const imageDataURL = canvas.toDataURL('image/png');

            const a = document.createElement('a');
            a.href = imageDataURL;
            const fileName = currentPatternName ? `${currentPatternName}_${currentTempo}BPM_pattern.png` : `drum_pattern_${currentTempo}BPM.png`;
            a.download = fileName;
            document.body.appendChild(a);
            a.click();
            document.body.removeChild(a);

        } catch (error) {
            console.error('スクリーンショットの取得中にエラーが発生しました:', error);
            alert('スクリーンショットの取得に失敗しました。開発者ツールでエラーを確認してください。');
        } finally {
            if (h1Title) h1Title.style.display = '';
            if (topControlsRow) topControlsRow.style.display = '';
            if (bottomControlsRow) bottomControlsRow.style.display = '';

            if (tempCaptureContainer.parentNode) {
                tempCaptureContainer.parentNode.removeChild(tempCaptureContainer);
            }
        }
    };

    const addInstrumentTrack = async (instrumentData = null) => {
        if (instruments.length >= MAX_TRACKS) {
            alert(`追加できるトラックは最大${MAX_TRACKS}個までです。`);
            return;
        }

        let selectedName;
        let newColor;
        let sampleName;
        let midiNote = 0;
        let isDefaultTrack = false;

        if (instrumentData) {
            selectedName = instrumentData.name;
            newColor = instrumentData.color;
            sampleName = instrumentData.sampleName;
            midiNote = instrumentData.midiNote;
            isDefaultTrack = true;
        } else {
            selectedName = newInstrumentNameInput.value.trim();
            newColor = newInstrumentColorPicker.value;
            sampleName = selectedName;

            midiNote = nextCustomMidiNote;
            nextCustomMidiNote++;

            if (nextCustomMidiNote > 127) {
                console.warn('MIDIノート番号が上限に達しました。割り当てをリセットまたは手動で調整してください。');
                nextCustomMidiNote = 50;
            }
            alert(`カスタムトラック "${selectedName}" にはMIDIノート番号 ${midiNote} が自動的に割り当てられました。これは必要に応じてMIDIファイルを編集することで変更できます。`);
        }

        if (!selectedName) {
            if (!isDefaultTrack) alert('追加する楽器の名前を入力してください。');
            return;
        }

        if (instruments.some(inst => inst.name.toLowerCase() === selectedName.toLowerCase())) {
            if (!isDefaultTrack) alert(`「${selectedName}」という楽器は既に追加されています。別の名前を入力してください。`);
            return;
        }

        let audioBuffer = null;
        if (isDefaultTrack && defaultSamplesBase64[sampleName]) {
            try {
                audioBuffer = await decodeBase64Audio(defaultSamplesBase64[sampleName]);
                console.log(`Default sample "${sampleName}" loaded for new track.`);
            } catch (error) {
                console.error(`Error decoding default sample ${sampleName}:`, error);
                if (!isDefaultTrack) alert(`楽器「${selectedName}」のオーディオデコードに失敗しました。クリック音で代替されます。`);
            }
        } else if (!isDefaultTrack) {
            console.log(`Custom track "${selectedName}" added without initial sample. User needs to upload.`);
        }

        instruments.push({
            name: selectedName,
            color: newColor,
            volume: 0.7,
            audioBuffer: audioBuffer,
            sampleName: sampleName,
            isCustomSample: !isDefaultTrack,
            customSampleBase64: instrumentData ? instrumentData.customSampleBase64 : null, // ★修正済み★
            midiNote: midiNote
        });
        pattern.push(Array(numSteps).fill(false));

        if (!isDefaultTrack) {
            createGrid();
            newInstrumentNameInput.value = '';
            colorIndex = (colorIndex + 1) % defaultColors.length;
            newInstrumentColorPicker.value = defaultColors[colorIndex];
            updateAddTrackButtonState();
        }
    };

    const loadPresetsFromLocalStorage = () => {
        const storedPresetsRaw = localStorage.getItem('drumSequencerPresets');
        let storedPresets = {};
        if (storedPresetsRaw) {
            try {
                storedPresets = JSON.parse(storedPresetsRaw);
            } catch (e) {
                console.error("Failed to parse drumSequencerPresets from localStorage:", e);
            }
        }

        // ★変更点：builtInPresets をまずロードし、その後 localStorage からのプリセットで上書き（優先）する★
        presets = JSON.parse(JSON.stringify(builtInPresets)); // builtInPresetsをコピーして初期化
        for (const key in storedPresets) {
            presets[key] = storedPresets[key]; // localStorageのプリセットで上書きまたは追加
        }

        // ここから既存のデータマイグレーション/補完ロジック
        for (const presetName in presets) {
            presets[presetName].instruments.forEach(inst => {
                if (inst.volume === undefined) {
                    inst.volume = 0.7;
                }
                inst.audioBuffer = null; // オーディオバッファはロード時に再生成

                if (inst.isCustomSample === undefined) {
                    // isCustomSampleが未定義の場合、defaultSamplesBase64に存在しない場合はカスタムとみなす
                    inst.isCustomSample = !defaultSamplesBase64[inst.sampleName];
                }

                if (inst.midiNote === undefined) {
                    const defaultTrack = defaultTracks.find(dt => dt.name === inst.name);
                    inst.midiNote = defaultTrack ? defaultTrack.midiNote : 36;
                }

                // customSampleBase64がない場合は削除（冗長なプロパティを防ぐ）
                if (inst.isCustomSample && !inst.customSampleBase64) {
                    delete inst.customSampleBase64;
                }
                if (inst.isCustomSample === false && inst.customSampleBase64) {
                    delete inst.customSampleBase64; // デフォルトサンプルなのにBase64があれば削除
                }
            });
            if (presets[presetName].genreName === undefined) {
                presets[presetName].genreName = '';
            }
            if (presets[presetName].tempoMode === undefined) {
                 presets[presetName].tempoMode = 'quarter'; // tempoModeのデフォルト値も追加
            }
        }
        updatePresetList();
    };

    const savePresetsToLocalStorage = () => {
        const serializablePresets = JSON.parse(JSON.stringify(presets));
        for (const presetName in serializablePresets) {
            // 組み込みプリセットは保存しない
            if (builtInPresets[presetName]) {
                delete serializablePresets[presetName];
                continue;
            }
            serializablePresets[presetName].instruments.forEach(inst => {
                delete inst.audioBuffer;
            });
        }
        localStorage.setItem('drumSequencerPresets', JSON.stringify(serializablePresets));
        console.log('Presets saved to localStorage.');
    };

    const updatePresetList = () => {
        presetSelector.innerHTML = '<option value="">プリセットを選択...</option>';

        // プリセットをジャンルごとにグループ化
        const groupedPresets = {};
        for (const name in presets) {
            const preset = presets[name];
            const genre = preset.genreName && preset.genreName.trim() !== '' ? preset.genreName.trim() : '未分類 (Uncategorized)'; // ジャンル名がない場合は「未分類」とする
            if (!groupedPresets[genre]) {
                groupedPresets[genre] = [];
            }
            groupedPresets[genre].push({ name: name, data: preset });
        }

        // ジャンル名をソート
        const sortedGenres = Object.keys(groupedPresets).sort((a, b) => {
            // "未分類" を一番最後に表示する
            if (a === '未分類 (Uncategorized)') return 1;
            if (b === '未分類 (Uncategorized)') return -1;
            return a.localeCompare(b);
        });


        // ソートされたジャンルごとにoptgroupを作成
        sortedGenres.forEach(genre => {
            const optgroup = document.createElement('optgroup');
            optgroup.label = `--- ${genre} ---`;

            // そのジャンル内のプリセットを名前でソート
            groupedPresets[genre].sort((a, b) => a.name.localeCompare(b.name)).forEach(preset => {
                const option = document.createElement('option');
                option.value = preset.name;
                option.textContent = preset.name;
                optgroup.appendChild(option);
            });
            presetSelector.appendChild(optgroup);
        });

        if (Object.keys(presets).length === 0) {
            loadPresetButton.disabled = true;
            deletePresetButton.disabled = true;
        } else {
            loadPresetButton.disabled = false;
            deletePresetButton.disabled = false;
        }
    };

    const updateScreenshotPatternNameDisplay = () => {
        const displayTempo = currentTempo ? ` (${currentTempo} BPM)` : '';
        const displayName = currentPatternName || 'パターン名: (なし)';
        const displayGenre = currentGenreName ? ` / ジャンル: ${currentGenreName}` : '';

        let modeText = '';
        if (currentTempoMode === 'quarter') {
            modeText = ' (4分音符)';
        } else if (currentTempoMode === 'shuffle') {
            modeText = ' (シャッフル)';
        } else if (currentTempoMode === '16th') {
            modeText = ' (16ビート)';
        }

        screenshotPatternNameDisplay.textContent = `パターン名: ${displayName}${displayGenre}${displayTempo}${modeText}`;
    };

    const savePreset = () => {
        const presetName = savePresetNameInput.value.trim();
        if (!presetName) {
            alert('保存するパターン名を入力してください。');
            return;
        }

        if (instruments.length === 0) {
            alert('保存するトラックがありません。');
            return;
        }

        // プリセット名をそのまま現在のパターン名として設定
        currentPatternName = presetName;
        updateScreenshotPatternNameDisplay();

        const currentData = {
            instruments: instruments.map(inst => ({
                name: inst.name,
                color: inst.color,
                volume: inst.volume,
                sampleName: inst.sampleName,
                isCustomSample: inst.isCustomSample || false,
                customSampleBase64: inst.customSampleBase64 || null,
                midiNote: inst.midiNote
            })),
            pattern: JSON.parse(JSON.stringify(pattern)),
            tempo: currentTempo,
            patternName: currentPatternName, // savePresetNameInput の値を反映
            genreName: currentGenreName,
            tempoMode: currentTempoMode
        };

        if (presets[presetName] && builtInPresets[presetName] && !confirm(`「${presetName}」は組み込みプリセットです。上書きすることはできません。別の名前で保存してください。`)) {
             return;
        } else if (presets[presetName] && !builtInPresets[presetName] && !confirm(`「${presetName}」という名前のプリセットは既に存在します。上書きしますか？`)) {
            return;
        }

        presets[presetName] = currentData;
        savePresetsToLocalStorage();
        updatePresetList();
        alert(`プリセット「${presetName}」を保存しました！`);
        console.log(`プリセット「${presetName}」を保存しました。保存されたパターンデータ:`, currentData.pattern);
    };

    const loadPreset = () => {
        const selectedPresetName = presetSelector.value;
        if (!selectedPresetName) {
            alert('読み込むプリセットを選択してください。');
            return;
        }

        const presetData = presets[selectedPresetName];
        if (presetData) {
            if (confirm(`プリセット「${selectedPresetName}」を読み込みますか？現在のパターンは失われます。`)) {
                if (isPlaying) {
                    stopPlayback();
                }

                instruments = [];
                pattern = [];

                const loadPromises = presetData.instruments.map(async (instData, index) => {
                    let audioBuffer = null;
                    const isInstCustom = instData.isCustomSample !== undefined ? instData.isCustomSample : !defaultSamplesBase64[instData.sampleName];

                    if (isInstCustom && instData.customSampleBase64) {
                        try {
                            audioBuffer = await decodeBase64Audio(instData.customSampleBase64);
                            console.log(`Custom sample for ${instData.name} loaded from preset.`);
                        } catch (error) {
                            console.error(`Error decoding custom sample for ${instData.name} from preset:`, error);
                        }
                    } else if (!isInstCustom && defaultSamplesBase64[instData.sampleName]) {
                        try {
                            audioBuffer = await decodeBase64Audio(defaultSamplesBase64[instData.sampleName]);
                        } catch (error) {
                            console.error(`Error decoding default sample ${instData.sampleName} from preset:`, error);
                        }
                    } else {
                        console.warn(`No Base64 data found for sample: ${instData.sampleName} for ${instData.name}. Will use click sound if not custom or if custom data missing.`);
                    }

                    return {
                        index: index,
                        instrument: {
                            name: instData.name,
                            color: instData.color,
                            volume: instData.volume,
                            audioBuffer: audioBuffer,
                            sampleName: instData.sampleName,
                            isCustomSample: isInstCustom,
                            customSampleBase64: instData.customSampleBase64 || null,
                            midiNote: instData.midiNote
                        },
                        pattern: presetData.pattern[index] || Array(numSteps).fill(false)
                    };
                });

                Promise.all(loadPromises).then(results => {
                    instruments = new Array(results.length);
                    pattern = new Array(results.length);

                    results.forEach(item => {
                        instruments[item.index] = item.instrument;
                        pattern[item.index] = item.pattern;
                    });
                    console.log(`プリセットロード後のinstrumentsの状態:`, instruments);
                    console.log(`プリセットロード後のpatternの状態 (createGrid呼び出し前):`, JSON.stringify(pattern));

                    updateAddTrackButtonState();

                    currentTempo = presetData.tempo || 120;
                    tempoInput.value = currentTempo;
                    currentPatternName = presetData.patternName || '';
                    savePresetNameInput.value = currentPatternName; // 読み込んだパターン名をプリセット名入力欄に表示
                    currentGenreName = presetData.genreName || '';
                    genreNameInput.value = currentGenreName;

                    currentTempoMode = presetData.tempoMode || 'quarter';
                    document.querySelector(`input[name="tempoMode"][value="${currentTempoMode}"]`).checked = true;

                    updateScreenshotPatternNameDisplay();

                    createGrid();
                    alert(`プリセット「${selectedPresetName}」を読み込みました！`);
                }).catch(error => {
                    console.error("プリセットのロードまたはサンプル再読み込み中にエラー:", error);
                    alert("プリセットを読み込みましたが、一部のサンプルがロードできませんでした。");
                    createGrid();
                });

            } else {
                console.log('プリセットの読み込みがキャンセルされました。');
            }
        } else {
            alert('選択されたプリセットが見つかりません。');
        }
    };

    const deletePreset = () => {
        const selectedPresetName = presetSelector.value;
        if (!selectedPresetName) {
            alert('削除するプリセットを選択してください。');
            return;
        }
        
        if (builtInPresets[selectedPresetName]) {
            alert(`「${selectedPresetName}」は組み込みプリセットのため削除できません。`);
            return;
        }

        if (confirm(`プリセット「${selectedPresetName}」を本当に削除しますか？この操作は元に戻せません。`)) {
            delete presets[selectedPresetName];
            savePresetsToLocalStorage();
            updatePresetList();
            alert(`プリセット「${selectedPresetName}」を削除しました。`);
            console.log(`プリセット「${selectedPresetName}」が削除されました。`);
            if (currentPatternName === selectedPresetName) {
                currentPatternName = '';
                savePresetNameInput.value = ''; // プリセット名入力欄をクリア
                currentGenreName = '';
                genreNameInput.value = '';
                updateScreenshotPatternNameDisplay();
            }
        } else {
            console.log('プリセットの削除がキャンセルされました。');
        }
    };

    const togglePlayback = () => {
        if (audioContext.state === 'suspended') {
            audioContext.resume().then(() => {
                console.log('AudioContextが再開されました！');
                if (isPlaying) {
                    stopPlayback();
                } else {
                    startPlayback();
                }
            });
        } else {
            if (isPlaying) {
                stopPlayback();
            } else {
                startPlayback();
            }
        }
    };

    const startPlayback = () => {
        if (instruments.length === 0) {
            alert('再生するトラックがありません。トラックを追加してください。');
            return;
        }
        isPlaying = true;
        playPauseButton.textContent = '停止';
        playPauseButton.classList.add('playing');
        currentStep = 0;

        nextStepTime = audioContext.currentTime;

        scheduleNextStep();
        console.log(`再生が開始されました。テンポ: ${currentTempo} BPM.`);
    };

    const stopPlayback = () => {
        isPlaying = false;
        playPauseButton.textContent = '再生';
        playPauseButton.classList.remove('playing');
        clearInterval(playInterval);
        resetPlayBar();
        console.log('再生が停止されました。');
    };

    const scheduleNextStep = () => {
        if (!isPlaying) {
            return;
        }

        const prevSteps = gridContainer.querySelectorAll(`.step[data-step-index="${(currentStep - 1 + numSteps) % numSteps}"]`);
        prevSteps.forEach(step => step.classList.remove('current-step'));

        const currentSteps = gridContainer.querySelectorAll(`.step[data-step-index="${currentStep}"]`);
        currentSteps.forEach(step => step.classList.add('current-step'));

        pattern.forEach((instrumentPattern, instIndex) => {
            if (instrumentPattern[currentStep]) {
                const instrument = instruments[instIndex];
                if (instrument.audioBuffer) {
                    playSample(instrument.audioBuffer, instrument.volume, nextStepTime);
                } else {
                    playClickSound(instrument.volume, nextStepTime);
                }
            }
        });

        let beatDuration = 60 / currentTempo;
        let stepDuration = beatDuration / 4;

        if (currentTempoMode === 'shuffle') {
            const stepInBeat = currentStep % 4;
            if (stepInBeat === 0 || stepInBeat === 1) {
                nextStepTime += stepDuration * SHUFFLE_RATIO * 2;
            } else {
                nextStepTime += stepDuration * (1 - SHUFFLE_RATIO) * 2;
            }
        } else if (currentTempoMode === '16th') {
            nextStepTime += stepDuration / 2;
        } else {
            nextStepTime += stepDuration;
        }

        currentStep = (currentStep + 1) % numSteps;

        if (isPlaying) {
            const delay = Math.max(0, nextStepTime - audioContext.currentTime) * 1000;
            setTimeout(scheduleNextStep, delay);
        }
    };

    const resetPlayBar = () => {
        const allSteps = gridContainer.querySelectorAll('.step');
        allSteps.forEach(step => step.classList.remove('current-step'));
        currentStep = 0;
    };

    const playClickSound = (volume = 0.7, when = 0) => {
        const oscillator = audioContext.createOscillator();
        const gainNode = audioContext.createGain();

        oscillator.connect(gainNode);
        gainNode.connect(audioContext.destination);

        oscillator.type = 'sine';
        oscillator.frequency.setValueAtTime(880, when);

        gainNode.gain.setValueAtTime(volume, when);
        gainNode.gain.exponentialRampToValueAtTime(0.001, when + 0.05);

        oscillator.start(when);
        oscillator.stop(when + 0.05);
    };

    const playSample = (audioBuffer, volume = 0.7, when = 0) => {
        if (!audioBuffer) {
            console.warn("AudioBufferがnullです。サンプルを再生できません。");
            return;
        }

        const source = audioContext.createBufferSource();
        const gainNode = audioContext.createGain();

        source.buffer = audioBuffer;
        source.connect(gainNode);
        gainNode.connect(audioContext.destination);

        gainNode.gain.setValueAtTime(volume, when);

        source.start(when);
    };

    async function decodeBase64Audio(base64String) {
        const base64Data = base64String.split(',')[1];
        const byteCharacters = atob(base64Data);
        const byteNumbers = new Array(byteCharacters.length);
        for (let i = 0; i < byteCharacters.length; i++) {
            byteNumbers[i] = byteCharacters.charCodeAt(i);
        }
        const byteArray = new Uint8Array(byteNumbers);
        const arrayBuffer = byteArray.buffer;

        return await audioContext.decodeAudioData(arrayBuffer);
    }

    const updateAddTrackButtonState = () => {
        if (instruments.length >= MAX_TRACKS) {
            addTrackButton.disabled = true;
            newInstrumentNameInput.disabled = true;
            newInstrumentNameInput.placeholder = `最大${MAX_TRACKS}トラックまで`;
        } else {
            addTrackButton.disabled = newInstrumentNameInput.value.trim() === '';
            newInstrumentNameInput.disabled = false;
            newInstrumentNameInput.placeholder = '新しい楽器名';
        }
    };

    newInstrumentNameInput.addEventListener('input', updateAddTrackButtonState);


    const exportMidi = () => {
        if (instruments.length === 0 || pattern.flat().every(step => !step)) {
            alert('エクスポートするパターンがありません。トラックを追加してステップを打ち込んでください。');
            return;
        }

        const ticksPerBeat = 96;
        const ticksPer16th = ticksPerBeat / 4;

        // ★修正点1: 各ステップの絶対開始ティックを再生ロジックと同様に事前に計算する★
        let absoluteStepStartTicks = [];
        let currentTickAccumulator = 0;
        const quantized16thDurationTicks = ticksPer16th; // 24 ticks per 16th note

        for (let i = 0; i < numSteps; i++) {
            absoluteStepStartTicks.push(Math.round(currentTickAccumulator));

            if (currentTempoMode === 'shuffle') {
                const stepInBeat = i % 4; // 拍の中のステップ位置 (0, 1, 2, 3)
                if (stepInBeat === 0 || stepInBeat === 1) { // 強拍またはその次の16分音符
                    currentTickAccumulator += quantized16thDurationTicks * SHUFFLE_RATIO * 2;
                } else { // その他の裏拍の16分音符
                    currentTickAccumulator += quantized16thDurationTicks * (1 - SHUFFLE_RATIO) * 2; // ★ここを修正しました★
                }
            } else if (currentTempoMode === '16th') {
                currentTickAccumulator += quantized16thDurationTicks / 2; // 32分音符相当
            } else { // 'quarter' mode (標準の16分音符)
                currentTickAccumulator += quantized16thDurationTicks;
            }
        }
        console.log('Pre-calculated absoluteStepStartTicks:', absoluteStepStartTicks);


        let combinedTrackEvents = [];
        let absoluteEvents = []; // イベントを絶対ティックで保持

        // ★修正点2: 事前計算したabsoluteStepStartTicksを使用してノートを配置する★
        instruments.forEach((instrument, instIndex) => {
            for (let i = 0; i < numSteps; i++) {
                if (pattern[instIndex][i]) {
                    const tickOn = absoluteStepStartTicks[i];
                    // ノートの長さは、標準の16分音符のデュレーションとする（シャッフルで開始がずれても、個々のノートの長さは一定にするのが一般的）
                    const tickOff = tickOn + ticksPer16th - 1;

                    absoluteEvents.push({
                        tick: tickOn,
                        type: 'noteOn',
                        midiNote: instrument.midiNote,
                        velocity: 0x64
                    });
                    absoluteEvents.push({
                        tick: tickOff,
                        type: 'noteOff',
                        midiNote: instrument.midiNote,
                        velocity: 0x00
                    });
                }
            }
        });

        // テンポイベントを絶対時間0に追加
        absoluteEvents.push({
            tick: 0,
            type: 'tempo',
            tempo: currentTempo
        });

        // イベントを時間でソート
        absoluteEvents.sort((a, b) => {
            if (a.tick !== b.tick) {
                return a.tick - b.tick;
            }
            // 同じティックの場合の優先順位: テンポ > Note Off > Note On
            if (a.type === 'tempo') return -1;
            if (b.type === 'tempo') return 1;
            if (a.type === 'noteOff' && b.type === 'noteOn') return -1;
            if (a.type === 'noteOn' && b.type === 'noteOff') return 1;
            return 0;
        });

        let lastAbsoluteTick = 0;

        // ソートされたイベントからデルタタイムを計算してトラックイベントを構築
        absoluteEvents.forEach(event => {
            const deltaTime = event.tick - lastAbsoluteTick;
            // デルタタイムが負になる場合は0にする（理論的には発生しないはずだが念のため）
            combinedTrackEvents.push(...encodeVarLength(Math.max(0, deltaTime)));

            if (event.type === 'noteOn') {
                combinedTrackEvents.push(0x99); // Note On (Channel 9 for drums)
                combinedTrackEvents.push(event.midiNote);
                combinedTrackEvents.push(event.velocity);
            } else if (event.type === 'noteOff') {
                combinedTrackEvents.push(0x89); // Note Off (Channel 9 for drums)
                combinedTrackEvents.push(event.midiNote);
                combinedTrackEvents.push(event.velocity);
            } else if (event.type === 'tempo') {
                combinedTrackEvents.push(0xFF, 0x51, 0x03); // セットテンポ
                const microSecondsPerBeat = 60000000 / event.tempo;
                combinedTrackEvents.push(
                    (microSecondsPerBeat >> 16) & 0xFF,
                    (microSecondsPerBeat >> 8) & 0xFF,
                    microSecondsPerBeat & 0xFF
                );
            }
            lastAbsoluteTick = event.tick;
        });

        // トラックの最後にエンドオブトラックメタイベントを追加
        // ★修正点3: パターン全体の最終的なデュレーションも累積ティックから計算する★
        const finalPatternDurationTicks = Math.round(currentTickAccumulator);
        const deltaTimeToEnd = finalPatternDurationTicks - lastAbsoluteTick;

        // deltaTimeToEndが負になる可能性があるので、最小で0をpushする
        combinedTrackEvents.push(...encodeVarLength(Math.max(0, deltaTimeToEnd)));
        combinedTrackEvents.push(0xFF, 0x2F, 0x00); // End of Track


        const trackData = new Uint8Array(combinedTrackEvents);
        const trackLength = trackData.length;

        const headerChunk = [
            0x4d, 0x54, 0x68, 0x64, // MThd
            0x00, 0x00, 0x00, 0x06, // length 6
            0x00, 0x00,             // フォーマットタイプ 0
            0x00, 0x01,             // 常に1トラック
            0x00, 0x60              // タイムディビジョン (96ティック/拍)
        ];

        const trackHeader = [
            0x4d, 0x54, 0x72, 0x6b, // MTrk
            (trackLength >> 24) & 0xFF, (trackLength >> 16) & 0xFF,
            (trackLength >> 8) & 0xFF, trackLength & 0xFF
        ];

        let midiFileBytes = new Uint8Array(0);
        midiFileBytes = concatUint8Arrays(midiFileBytes, new Uint8Array(headerChunk));
        midiFileBytes = concatUint8Arrays(midiFileBytes, new Uint8Array(trackHeader));
        midiFileBytes = concatUint8Arrays(midiFileBytes, trackData);

        const blob = new Blob([midiFileBytes], { type: 'audio/midi' });
        const url = URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        const fileName = currentPatternName ? `${currentPatternName}_${currentTempo}BPM_shuffle.mid` : `drum_pattern_${currentTempo}BPM_shuffle.mid`;
        a.download = fileName;
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(url);

        alert('MIDIファイルがエクスポートされました！');
        console.log('MIDI file exported:', fileName);
    };

    function encodeVarLength(value) {
        let buffer = [];
        buffer.unshift(value & 0x7F);
        value >>= 7;

        while (value > 0) {
            buffer.unshift((value & 0x7F) | 0x80);
            value >>= 7;
        }
        return buffer;
    }

    function concatUint8Arrays(a, b) {
        let c = new Uint8Array(a.length + b.length);
        c.set(a, 0);
        c.set(b, a.length);
        return c;
    }

